import React, { Component } from 'react'

export class Search extends Component {
    constructor(){
        super();
        this.state={
            text:"",
        }
    }

    handlechange=(event)=>{
        this.setState({text:target.event.value})
    }

    render() {
        return (
            <div className='container'>
                 <form className="d-flex ip my-4">
        <input className="form-control me-2 " type="search" placeholder="Search" value={this.state.text} onChange={this.handlechange} aria-label="Search"/>

      </form>
      <button className="btn btn-outline-primary btn" type="submit">Search</button>
            </div>
        )
    }
}

export default Search
